Es wurden 3.920 Euro netto vom Hof Beermann bezahlt. Da das Programm seit Beginn des Jahres bei uns liegt, wird die vereinbarte Hosting-Gebühr in Höhe von ca. 104 Euro monatlich fällig.

Ein WordPress-Service oder andere Zusatzleistungen unserseits sind nicht notwendig, da die Webseite extern betrieben wird.

Soll-Zustand:

Ab Oktober werden wir die Weiterentwicklung des Programms in Angriff nehmen (Druckeranbindung und Shopanbindung). Beides sollte ursprünglich von einem ehemaligen Mitarbeiter (Lukas Meinecke) entwickelt sein – dies muss jedoch noch geprüft werden.

Die Rechnung für die Weiterentwicklung soll zum 01.01.2026 in Höhe von 1.080 Euro gestellt werden, sodass wir insgesamt auf die ursprünglich vereinbarten 5.000 Euro kommen.

Mathias Liecker erwähnte, dass wir eventuell Rabatt gewähren könnten, wenn der Hof Beermann Werbung für uns macht. Angeblich sei der Hof sehr medienwirksam und häufig in der Zeitung sowie in den sozialen Medien präsent.

